                      <option>$</option>
                      <option>£</option>
                      <option>€</option>
                    </select>
                  </span>
                </p>
                <p className="control">
                  <input
                    className="input"
                    type="text"
                    value={project_budget}
                    onChange={(ev) => setProject_budget(ev.target.value)}
                    placeholder="Amount of money (0.00)"
                  />
                </p>
              </div>
            </div>
            {/* Submit Button  */}

            <div className="buttons">
              <button className="button is-primary" type="submit">
                Submit
